import React, {useState,setState} from 'react';
// import './style.css'
function RegistrationForm() {
    
    const [fullName, setfullName] = useState(null);
    const [carModel, setCarModel] = useState(null);
    const [carColor, setCarColor] = useState(null);
    const [email, setEmail] = useState(null);
    const [phoneNo,setPhoneNo] = useState(null);
    const [carNumber,setCarNumber] = useState(null);
    const [Address,setAddress] = useState(null);
    const [age,setAge] = useState(null);
    const [payment,setPayment] = useState(null);
    const [duration,setDuration] = useState(null);





    const handleInputChange = (e) => {
        const {id , value} = e.target;
        if(id === "fullName"){
            setFullName(value);
        }
        if(id === "carModel"){
            setcarModel(value);
        }
        if(id === "carColor"){
            setcarColor(value);
        }
        if(id === "email"){
            setEmail(value);
        }
        if(id === "carNumber"){
            setCarNumber(value);
        }
        if(id === "phoneNo"){
            setPhoneNo(value);
        }
        
        if(id === "address"){
            setAddress(value);
        }
        if(id === "age"){
            setAge(value);
        }
        if(id === "payment"){
            setAge(value);
        }
        if(id === "duration"){
            setDuration(value);
        }

    }

    const handleSubmit  = () => {
        console.log(firstName,lastName,email,password,confirmPassword);
    }

    return(
        <div className="form">
            <div className="form-body">
                <div className="full-Name">
                    <label className="form__label" for="fullName">Full Name </label>
                    <input className="form__input" type="text" value={fullName} onChange = {(e) => handleInputChange(e)} id="fullName" placeholder="Full Name"/>
                </div>
                <div className="carModel">
                    <label className="form__label" for="carModel">Car Model </label>
                    <input  type="text" name="" id="carModel" value={carModel}  className="form__input" onChange = {(e) => handleInputChange(e)} placeholder="Car Model"/>
                </div>
                <div className="carColor">
                    <label className="form__label" for="carColor">Car Color </label>
                    <input  type="text" name="" id="carColor" value={carColor}  className="form__input" onChange = {(e) => handleInputChange(e)} placeholder="Car Color"/>
                </div>
                <div className="email">
                    <label className="form__label" for="email">Email </label>
                    <input  type="email" id="email" className="form__input" value={email} onChange = {(e) => handleInputChange(e)} placeholder="Email"/>
                </div>
                <div className="phoneNo">
                    <label className="form__label" for="phoneNo">Phone No</label>
                    <input className="form__input" type="phoneNo"  id="phoneNo" value={phoneNo} onChange = {(e) => handleInputChange(e)} placeholder="Phone No"/>
                </div>
                <div className="carNumber">
                    <label className="form__label" for="carNumber">Car Number</label>
                    <input className="form__input" type="carNumber" id="carNumber" value={carNumber} onChange = {(e) => handleInputChange(e)} placeholder="carNumber"/>
                </div>
                <div className="address">
                    <label className="form__label" for="address"> Address </label>
                    <input className="form__input" type="address" id="address" value={address} onChange = {(e) => handleInputChange(e)} placeholder="Address"/>
                </div>
                <div className="age">
                    <label className="form__label" for="age">Age </label>
                    <input className="form__input" type="age" id="age" value={age} onChange = {(e) => handleInputChange(e)} placeholder="Age"/>
                </div>
                <div className="payment">
                    <label className="form__label" for="payment">Payment</label>
                    <input className="form__input" type="payment" id="payment" value={payment} onChange = {(e) => handleInputChange(e)} placeholder="Payment"/>
                    <form onSubmit={handleSubmit}>
                        <label>
                            Amount:
                            <input type="number" value={amount} onChange={(e) => setAmount(e.target.value)} />
                        </label>
                        <label>
                            Payment Method:
                            <select value={paymentMethod} onChange={(e) => setPaymentMethod(e.target.value)}>
                                <option value="gpay">GPay</option>
                                <option value="phonepe">PhonePe</option>
                                <option value="paytm">Paytm</option>
          <option value="card">Credit/Debit Card</option>
        </select>
      </label>
      {paymentMethod === 'card' && (
        <>
          <label>
            Card Number:
            <input type="text" value={cardNumber} onChange={(e) => setCardNumber(e.target.value)} />
          </label>
          <label>
            Expiry Date:
            <input type="text" value={expiryDate} onChange={(e) => setExpiryDate(e.target.value)} />
          </label>
          <label>
            CVV:
            <input type="text" value={cvv} onChange={(e) => setCvv(e.target.value)} />
          </label>
        </>
      )}
      <button type="submit">Pay Now</button>
    </form>
                </div>
                <div className="duration">
                    <label className="form__label" for="duration">Duration</label>
                    <input className="form__input" type="duration" id="duration" value={duration} onChange = {(e) => handleInputChange(e)} placeholder=" Duration"/>
                </div>
            </div>
            <div class="footer">
                <button onClick={()=>handleSubmit()} type="submit" class="btn">Register</button>
            </div>
        </div>
       
    )       
}

export default RegistrationForm;
